import React from 'react';
import { Button, Card, List, Comment } from 'antd';
import { StarOutlined, EllipsisOutlined, InstagramOutlined, MessageOutlined } from '@ant-design/icons';
import styled from 'styled-components';

const SaleWrapper = styled.div`
  padding: 10px;
`;


const Sale = () => {
  return (
    <SaleWrapper>
      <div>특가 상품</div>
      <Card 
        style={{ width: 300 }} 
        actions={[
          <StarOutlined />,
          <InstagramOutlined />,
          <MessageOutlined />,
          <EllipsisOutlined />,
      ]}>
        세일
      </Card>
    </SaleWrapper>
  );
};

export default Sale;
